import * as React from 'react';
import { ProgressBar } from 'react-bootstrap';
import Chart from 'react-google-charts';
import 'bootstrap/dist/css/bootstrap.min.css';

export const data = [
    ["Category", "Expenses", { role: 'style' }, { role: 'annotation'}],
    ["", 200, '#b87333', "Utilities"],
    ["", 200, '#b87333', "Entertainment"],
    ["", 400, '#b87333', "Food"],
    ["", 250, '#b87333', "Transportation"],
    ["", 350, '#b87333', "Miscellaneous"],
    ["Rent", 800, '#b87333', "Rent"]
  ];

export const options = {
    chart: {
      title: "Budget",
    },
  };


const Budget = () => {
    return (
        <div>
            This is the budget page
            <div>
                <Chart 
                chartType='BarChart'
                width="80%"
                height="400px"
                data={data}
                options={options}
                />
            </div>
        </div>
    )
}

export default Budget;
